import amazonLogo from '../images/companies/amazon_logo.png'
import feupLogo from '../images/companies/feup_logo.png'
import CircleImage from '../components/circleImage/CircleImage'

function Timeline() {
  return (
    <>
      <div className='timeline'></div>
      <CircleImage imagePath={amazonLogo} alt={'Amazon Logo'} width={80} height={80}/>
      <CircleImage imagePath={feupLogo} alt={'FEUP Logo'} width={80} height={80}/>
    </>
  )
}

export default Timeline;
